INSERT INTO `produto` VALUES (31,' SSD SATA WD Green, 480GB, 2.5\", Leitura: 545MB/s e Gravação: 430MB/s, Preto',10,'SSD WD Green, 480GB, SATA, Leitura 545MB/s, Gravação 430MB/s\r\n \r\n\r\nDesempenho aprimorado para computação do dia-a-dia\r\nCom o aumento de desempenho de um SSD SATA WD Green, você pode navegar na web, jogar um jogo ou simplesmente iniciar seu sistema rapidamente.\r\n\r\n \r\n\r\nDurabilidade do estado sólido\r\nLeves e resistentes a choques, os SSDs WD Green não usam peças móveis e ajudam a manter seus dados seguros contra perdas no caso de pancadas ou quedas acidentais.\r\n\r\n \r\n\r\nMenos energia. Mais jogos.\r\nOs SSDs WD Green estão entre as unidades de menor consumo de energia da indústria. Com menos energia usada, seu laptop opera por mais tempo.\r\n\r\n \r\n\r\nUm upgrade fácil para seu PC\r\nCompatível com a maioria dos PCs desktop e laptop, os SSDs WD Green e construído com 2,5” / 7 mm e para um upgrade simples e sem preocupações.\r\n\r\n \r\n\r\nSoftware WD SSD Dashboard e Acronis para download\r\nMonitore a integridade de sua unidade com o software gratuito para download WD SSD Dashboard, e clone unidades com o software Acronis True Image WD Edition.\r\n\r\n \r\n\r\nAproveite essa oportunidade e adquira seu SSD WD Green de 480GB',307.99,339.99,40.00,219.00,'Novo',20,5,'Características:\r\n\r\n- Marca: WD Green\r\n\r\n- Modelo: WDS480G3G0A\r\n\r\n \r\n\r\nEspecificações:\r\n\r\n- Seq. Leitura até (MB/s): 545\r\n\r\n\r\n\r\nEnergia:\r\n\r\n- Potência ativa média (mW): 60\r\n\r\n- Máx. Leitura Operacional (mW): 1.700\r\n\r\n- Sono (mW): 26\r\n\r\n- DEVSLP (mW): 10\r\n\r\n \r\n\r\nConfiabilidade:\r\n\r\n- MTTF‡‡: Até 1,0 milhão de horas\r\n\r\n \r\n\r\nAmbiental:\r\n\r\n- Temperaturas de operação‡‡‡: 0°C a 70°C\r\n\r\n- Temperaturas não operacionais: -55°C a 85°C\r\n\r\n- Vibração operacional: 5,0 gRMS, 10-2000 Hz\r\n\r\n- Vibração não operacional: 4,9 gRMS, 7-800 Hz\r\n\r\n- Choque: 1.500 G @ 0,5 ms de meio seno\r\n\r\n- Certificações: FCC, UL, TUV, KC, BSMI, VCCI, CE, Marrocos, RCM, UKCA\r\n\r\n \r\n\r\nDimensões físicas 2,5\"\"/7mm com caixa\":\r\n\r\n- Fator de forma: 2,5\"/7mm\r\n\r\n- Comprimento: 100,5 mm\r\n\r\n- Largura: 69,85 mm\r\n\r\n- Altura: 7,00mm\r\n\r\n- Peso (± 0,5g): 36,2 ± 0,5\r\n\r\n\r\n\r\nConteúdo da Embalagem:\r\n\r\n- SSD WD Green, 480GB\r\n\r\n\r\nGarantia:\r\n3 anos de garantia (3 meses de garantia legal + 33 meses de garantia contratual junto ao fabricante)\r\n\r\nPeso:\r\n66 gramas (bruto com embalagem)',NULL,NULL,2,0),(32,'SSD 1 TB Kingston NV2, M.2 2280 PCIe, NVMe, Leitura: 3500 MB/s e Gravação: 2100 MB/s ',10,'SSD Kingston NV2 1 TB, M.2 2280 PCIe, NVMe, Leitura: 3500 MB/s e Gravação: 2100 MB/s\r\n \r\nSolução de Ultima geração\r\nO NV2 PCIe 4.0 NVMe SSD da Kingston é uma solução substancial de armazenamento de última geração alimentada por um controlador Gen 4x4 NVMe. O NV2 oferece velocidades de leitura/gravação de até 3.500/2.100 MB/s com menores requisitos de energia e menor aquecimento para ajudar a otimizar o desempenho do seu sistema e agregar valor sem sacrifícios.\r\n\r\n \r\n\r\nCompacto\r\nO design compacto de face única M.2 2280 (22x80mm) expande o armazenamento em até 2TB** enquanto economiza espaço para outros componentes, tornando o NV2 ideal para notebooks mais finos, sistemas de formato pequeno (SFF) e placas-mãe DIY.\r\nInstalar um SSD (Disco de estado sólido) M.2 é fácil e aumentará significativamente o desempenho do seu computador. Siga esses passos abaixo para acelerar seu dispositivo e aumentar o espaço livre de armazenamento.\r\n\r\n \r\n\r\nMais Armazenamento para Você\r\nDisponível em capacidades de 1 TB para oferecer todo o espaço necessário para aplicativos, documentos, fotos, vídeos e muito mais.\r\nIntegra-se facilmente em modelos com conectores M.2. Perfeito para laptops finos e PCs de formato pequeno.\r\n\r\n \r\n\r\nAproveite essa oportunidade e adquira seu SSD Kingston NV2 1 TB!',644.99,710.99,40.00,460.00,'Novo',20,5,'Características:\r\n\r\n- Marca: Kingston\r\n\r\n- Modelo: NV2S/1000G\r\n\r\n \r\n\r\nEspecificações:\r\n\r\n- Fator de forma: M.2 2280\r\n\r\n- Interface: PCIe 4.0 x4 NVMe\r\n\r\n- Capacidades: 1TB\r\n\r\n\r\n\r\nLeitura/Gravação Sequencial:\r\n\r\n- 3.500/2.100 MB/s\r\n\r\n \r\n\r\nResistência (Total de Bytes Gravados):\r\n\r\n- 320TB\r\n\r\n \r\n\r\nConsumo de energia:\r\n\r\n- 1,4 W Inativo / 2,8 W Médio / 2,1 W (MAX) Leitura / 4,6 W (MAX) Gravação\r\n\r\n \r\n\r\nOperacional:\r\n\r\n- Temperatura de armazenamento: -40°C~85°C\r\n\r\n- Temperatura de operação: 0°C~70°C\r\n\r\n- Dimensões: 22mm x 80mm x 2,2mm\r\n\r\n- Peso: 7g (todas as capacidades)\r\n\r\n- Vibração Operacional: 2,17 G (7-800 Hz)\r\n\r\n- Vibração Não operacional: 20G (20-1000Hz)\r\n\r\n- MTBF: 1.500.000 horas\r\n\r\n \r\n\r\nConteúdo da Embalagem:\r\n\r\n- SSD Kingston NV2 1 TB\r\n\r\n\r\nGarantia:\r\n3 anos de garantia (3 meses de garantia legal + 33 meses de garantia contratual junto ao fabricante)\r\n\r\nPeso:\r\n39 gramas (bruto com embalagem)',NULL,NULL,2,1);
